import {useState} from 'react';
import './style.css'

const Navbar = () => {
    let Links = [
        { name: 'Home', link: '/' },
        { name: 'About', link: '/' },
        { name: 'Contact', link: '/' },
        { name: 'Project', link: '/' }
    ]
    let [open , setOpen] = useState(false);
    return (
        <div className='w-screen h-[80px] z-10 bg-color-primary'>
            <div className='px-2 flex justify-between items-center w-full h-full'>
                <div className='flex items-center'>
                    <h1 className='pl-3 md:pl-8 text-2xl'>Yohanes.<span>Albert</span></h1>
                </div>
                <div className='pr-8'>
                    <ul className='hidden md:flex'>
                        {
                            Links.map((Data) => (
                                <li key={Data.name} className='px-5 cursor-pointer text-white hover:text-gray-600'><a >{Data.name}</a></li>
                            ))
                        }
                    </ul>
                </div>
            <div className='md:hidden text-3xl pr-5 pt-2 cursor-pointer' onClick={()=>setOpen(!open)}>
                <ion-icon name={!open ? 'menu': 'close'}></ion-icon>
            </div>
            </div>
            <ul className={`md:hidden transition-all duration-300 ease-in ${!open ? 'hidden' : 'absolute bg-color-primary w-full mt-[-10px] pb-5'}`}>
                {
                    Links.map((Data) => (
                        <li key={Data.name} className='px-5 cursor-pointer py-3 text-white hover:text-gray-600 border hover:bg-white'><a >{Data.name}</a></li>
                    ))
                }
            </ul>
        </div>
    )
}

export default Navbar;
